import React from 'react'
import Thirdcard from './Thirdcard'
import "./third.css"
 
const data=[
  
  {
    "id": 2,
    "description": "Sweet and savory sauces relishes spreads and seasonings",
    "name": "Condiments"
  },
  {
    "id": 1,
    "description": "Soft drinks coffees teas beers and ales",
    "name": "Beverages"
  },
  {
    "id": 3,
    "description": "Desserts candies and sweet breads",
    "name": "Confections"
  },
  {
    "id": 4,
    "description": "Cheeses",
    "name": "Dairy Products"
  },
  {
    "id": 5,
    "description": "Breads crackers pasta and cereal",
    "name": "Grains/Cereals"
  },
  {
    "id": 6,
    "description": "Prepared meats",
    "name": "Meat/Poultry"
  },
  {
    "id": 7,
    "description": "Dried fruit and bean curd",
    "name": "Produce"
  },
  {
    "id": 8,
    "description": "Seaweed and fish",
    "name": "Seafood"
  }
]

function Third() {
  return (
    <div className='thirdContainer'>
        <div className='thirdHero'>
<h2 className='thirdHeader'>OUR SERVICES</h2>
<p className='thirdContent'>Far far away, behind the word mountains, far from the countries Vokalia and Consonantia, there live the blind texts.</p>
        </div>
      <Thirdcard icon=""></Thirdcard>
      <Thirdcard></Thirdcard>
      <Thirdcard></Thirdcard>
      <Thirdcard></Thirdcard>
      <Thirdcard></Thirdcard>
      <Thirdcard></Thirdcard>
    </div>
  )
}

export default Third
